import styled from "styled-components"
import { Image, Content, Description, Title } from "../components/modules"

const SecondPage = () => {
  return (
    <Background id="2">
      <Image src="images/moti.png" alt="moti" />
      <Content>
        <Title>Moti를 소개합니다!</Title>
        <Description>
          Moti는 1일 1커밋을 독려하기 위한 서비스에요. <br />
          꾸준한 자기개발을 통해 나만의 캐릭터 ‘모티’를 키워나갈 수 있어요.
          모티를 키워나가다 보면, 어느새 성장한 당신을 볼 수 있을 거에요!
        </Description>
      </Content>
    </Background>
  )
}

export default SecondPage

const Background = styled.div`
  height: 67vh;
  background: #f0f0f0;
  display: flex;
  align-items: center;
  justify-content: space-evenly;
`
